import React, { useState } from "react";
import { useLocation } from "react-router-dom";
import "./product.css";
import { Publish } from "@material-ui/icons";
import { useSelector, useDispatch } from "react-redux";
import { updateProduct } from '../../redux/apiCalls'

export default function Product() {
  const location = useLocation();
  const productId = location.pathname.split("/")[2];

  const product = useSelector((state) =>
    state.product.products.find((product) => product._id === productId)
  );

  const [updatedProduct, setUpdatedProduct] = useState({
    title: product.title,
    desc: product.desc,
    price: product.price,
    quantity: product.quantity,
    inStock: product.inStock,
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setUpdatedProduct((prevProduct) => ({
      ...prevProduct,
      [name]: value,
    }));
  };

  const dispatch = useDispatch();

  const handleUpdateProduct = (e) => {
    e.preventDefault();
    console.log(updatedProduct);
    dispatch(updateProduct(productId, updatedProduct));
  };

  return (
    <div className="product">
      <div className="productTitleContainer">
        <h1 className="productTitle">Update product</h1>
      </div>
      <div className="productTop">
        <div className="productTopRight">
          <div className="productInfoTop">
            <img src={product.img} alt="" className="productInfoImg" />
            <span className="productName">{product.title}</span>
          </div>
          <div className="productInfoBottom">
            <div className="productInfoItem">
              <span className="productInfoKey">id:</span>
              <span className="productInfoValue">{product._id}</span>
            </div>
            <div className="productInfoItem">
              <span className="productInfoKey">in stock:</span>
              <span className="productInfoValue">{product.inStock}</span>
            </div>
          </div>
        </div>
      </div>
      <div className="productBottom">
        <form className="productForm" onSubmit={handleUpdateProduct}>
          <div className="productFormLeft">
            <label>Product Name</label>
            <input
              type="text"
              name="title"
              value={updateProduct.title}
              onChange={handleInputChange}
            />
            <label>Product Description</label>
            <input
              type="text"
              name="desc"
              value={updateProduct.desc}
              onChange={handleInputChange}
            />
            <label>Price</label>
            <input
              type="text"
              name="price"
              value={updateProduct.price}
              onChange={handleInputChange}
            />
            <label>Quantity</label>
            <input
              type="text"
              name="quantity"
              value={updateProduct.quantity}
              onChange={handleInputChange}
            />
            <label>In Stock</label>
            <select
              name="inStock"
              value={updateProduct.inStock}
              onChange={handleInputChange}
            >
              <option value={true}>Yes</option>
              <option value={false}>No</option>
            </select>
          </div>
          <div className="productFormRight">
            <div className="productUpload">
              <img src={product.img} alt="" className="productUploadImg" />
              <label htmlFor="file">
                <Publish />
              </label>
              <input type="file" id="file" style={{ display: "none" }} />
            </div>
            <button className="productButton" type="submit" onClick={handleUpdateProduct}>
              Update
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}
